geregisseerd door Xan Cassavetes
met Milo Ventimiglia, Riley Keough en Michael Rapaport

Het verhaal gaat over twee mooie Franse vampierzussen die elk afzonderlijk verblijven in een zomerverblijf - een soort schuiladres in Connecticut. De &quot;goede&quot; van de twee zussen begint een relatie met een scenarioschrijver die haar wil volgen naar de wereld van de ondoden. Nadat ze samen hun nieuwe leven zijn begonnen, duikt de &quot;slechte&quot; zus echter op en veroorzaakt meteen grote chaos. Langzaam maar zeker dreigt haar duistere aanwezigheid iedereen te vernietigen.



